 import React from "react";
import {Link} from "react-router-dom";
import "./Home.css";
import lend from "./lend.jpg";
import find from "./find.jpg";

function Home() {
  return (

      <div className="home">
        <div className="header">
        <h2 style={{
              display:"inline-block",
              marginTop:25,
		        	marginLeft:"10%",
		        	marginRight:0,
              fontFamily:"arial",
              fontWeight:"bold",
              fontSize:"250%",
              color:"rgb(26, 180, 26)",
            }}>BOOK EXCHANGE PLATFORM</h2>
        <Link to="/register"><button className="buttoncomp">REGISTER</button></Link>
        <Link to="/login"><button className="buttoncomp">LOGIN</button></Link>
        </div>
        <div className="main">
          <div className="textcomp" style={{
              padding:100,
            }}>
            <div style={{

              color:"white",
              fontSize:20,
              textAlign:"justified",
            }}><h4>Do you feel that selling used books is a tiring and cumbersome process?</h4><br/><p>Don't you worry because our library website makes it so much easier by connecting the buyer and the seller with easy to use interface.</p><p>Exchanging books was never this easy!</p></div>
          </div>
          <div style={{
            display:"inline-block",
            position:"relative",
            left:180,

          }}>
            <img src={lend} alt="image"/>
            <h4 className="textcomp">Sell Books</h4>
            <p className="textcomp">
              Dont need a book you own?<br/>Sell used books lying idle on the shelf.
            </p>
          </div>
          <div style={{
            display:"inline-block",
            position:"relative",
            left:400,
          }}>
            <img src={find} alt="image"/>
            <h4 className="textcomp">Buy Books</h4>
            <p className="textcomp">
              Struggling to find books you like?<br/>Search for and Buy books with ease
            </p>
          </div>
        </div>
      </div>

  )
}
export default Home;
